d_reset_confirmation";s:302:"Hi,\r\n\r\nYour password has been reset.\r\n\r\nTo login please visit the following URL:\r\n\r\n{{userl_ultra_login_url}}\r\n\r\nYour account e-mail: {{userultra_user_email}}\r\n\r\nYour account username: {{userultra_user_name}}\r\n\r\nIf you have any problems, please contact us at {{userultra_admin_email}}.\r\n\r\nBest Regards!";s:33:"admin_account_active_message_body";s:142:"Hi,\r\n\r\nYour account has been activated.\r\n\r\nPlease use the link below to get in your account.\r\n\r\n{{userl_ultra_login_url}}\r\n\r\nBest Regards!\r\n\r\n";s:31:"admin_account_deny_message_body";s:146:"Hi,\r\n\r\nWe\'re sorry but your account has not been approved.\r\n\r\nThis is an automated notification. No further action is needed.\r\n\r\nBest Regards!\r\n\r\n";s:24:"messaging_send_from_name";s:18:"Users Ultra Plugin";s:17:"directory_page_id";s:3:"127";s:15:"update_settings";s:0:"";s:19:"update_uultra_slugs";s:12:"uultra_slugs";s:18:"uultra_nonce_check";s:10:"1c62a9c2a9";s:16:"_wp_http_referer";s:51:"/wp-admin/plugins.php?page=userultra&tab=permalinks";s:29:"xoousersultra_my_account_page";s:3:"125";s:25:"usersultra_permalink_type";s:2:"ID";}', 'yes'),
