(119, 137, 'historique', 'Le château a été bâti pendant la première moitié du XVIe siècle par Lancelot Ier du Lac, chambellan du roi de France Louis XII puis bailli d\'Orléans sous le règne du roi François Ier, sur l\'emplacement d\'une ancienne maison forte. Il a conservé la forme traditionnelle des forteresses médiévales mais a été conçu comme un château d\'habitation.\r\n============\r\nAu XVIe siècle, sous Lancelot II (petit-fils de Lancelot Ier) qui se rallie au protestantisme en 1562, Chamerolles se distingue en abritant un temple protestant dans une de ses pièces. Le château devint un haut lieu de la religion protestante dans la région. En 1672, Chamerolles appartient à Jacques Saumery, beau-frère de Jean-Baptiste Colbert, ministre du roi Louis XIV. Il est gouverneur du château royal de Chambord et du comté de Blois, maréchal des armées du roi et grand-maître des Eaux et Forêts d\'Île-de-France.\r\n============\r\nAu XVIIIe siècle, en 1774, le château devient la propriété des Lambert, puis celle de Gaston Jessé-Curély en 1924. Occupé, saccagé et dépouillé pendant la Seconde Guerre mondiale, il est mis en vente en 1970. En 1976, la Ville de Paris se retrouve avec la charge de Chamerolles. Délaissé, le château tombait en ruines.\r\n============\r\nAprès toutes des péripéties, c\'est donc une ruine en bien mauvais état que rachète le Conseil général du Loiret en 1987. Après cinq années de travaux, le château et ses jardins sont ouverts à la visite en 1992. La restauration a été effectuée par l\'architecte des Monuments historiques Jacques Moulin. Remeublé afin de restaurer l\'atmosphère à l\'époque de ses habitants, un musée des parfums est installé dans l\'aile sud. Le château accueille un ensemble de pièces et d\'objets uniques témoignant de l\'histoire du parfum et de l\'hygiène au fil des siècles. La muséographie autour du parfum a été confiée à Didier Moulin.'),
