(165, 146, 'historique', 'Le site de la forteresse est occupé depuis trois mille ans, comme l’ont révélé les fouilles archéologiques récentes. Il faut attendre la fin de l’époque gauloise pour connaître un peu ses habitants. Un aristocrate guerrier gaulois a érigé sa demeure à l\'emplacement de l\'actuel fort Saint-Georges.\r\n============\r\n Les archéologues ont retrouvé le fossé carré qui lui servait d’enceinte. À l’intérieur prenaient place des maisons particulières, des bâtiments agricoles, et un espace politique et/ou culturel. Le propriétaire des lieux fut enterré juste devant, avec sa grande épée, privilège accordé par César aux vétérans de ses troupes auxiliaires indigènes. \r\n============\r\nOn peut la voir dans la salle d\'archéologie du musée. À l’époque gallo-romaine, Chinon est déjà un petit bourg. Sur la hauteur, des constructions en pierre ou plus modestes, en torchis, se développent. Le secteur de la tombe gauloise cède progressivement la place à un petit cimetière, qui restera en usage jusqu’au Xe siècle.'),
