(260, 154, 'historique', 'VII-VIIIe siècle\r\nLe château fut édifié initialement pour se protéger des pillages, une "tourronde" en bois fut bâtie, qui jouait un rôle défensif et servait de logement au seigneur.\r\n\r\n============\r\n\r\n1097\r\nJean Germont, le seigneur d\'Esclimont à construire un solide château fort en pierre avec donjon quadrangulaire, qui est l’embryon du Château.\r\n\r\n============\r\n\r\n1543\r\nPendant la période de la Renaissance, Etienne de Poncher, en qualité de prélat, diplomate, commentateur de la Cour Suprême, élu évêque de Paris rebâtit le Château d\'Esclimont en s\'inspirant du style italien que son cousin a fait dans la Vallée de la Loire.\r\n\r\n============\r\n\r\n1580\r\nPhilippe Hurault, chancelier de France de Henry III, Ministre de la Justice de Henry IV, posséda de Château d\'Esclimont formellement. Après la mort de dernier héritier, ce château fut revendu à la famille Bullion.\r\n\r\n============\r\n\r\n1639\r\nClaude de Bullion, chef de l’Assemblée de Henry III, marquis de Gallardon, Ministre de la Justice de Marie et Médicis, eut acheté le Château d\'Esclimont, dont ses descendants n\'ont pas enlevé les risbans aux coins du château par respect de leurs ancêtres.\r\n\r\n============\r\n\r\n1807\r\nLe Château fut revendu à la famille Montmorency en cette année-là. Après le mariage d’Elisabeth Hélène Pierre (héritière de la famille Montmorency) et Louis François Sosthène de la famille RochefoucauldDou Deauville, il appartient à la famille de Rochefoucauld.\r\nFoucaud, né en 1019, le premier seigneur de la Roche, fondateur de la famille La Rochefoucauld, la plus célèbre en France. Son descendant, François de la Rochefoucauld, fut devenu parrain de François I en 1494. Sa statue équestre est érigée au tour de rempart de Château d\'Esclimont.\r\n\r\n============\r\n\r\n1865\r\nLeur fils, Marie Charles Sosthène de la Rochefoucauld Parent, aménagea ce château avec un style romantique de Renaissance. Il eut gravé sa devise "C’est mon plaisir" sur tous les balcons du château et l’eut misedans le nom de sa deuxième femme.\r\n\r\n============\r\n\r\n1981\r\nRené Traversac, fondateur de la chaîne d\'hôtel de luxe "Les Grandes Etapes Françaises", l\'a racheté de la comtesse Laure-Suzanne-Marie, la petite-fille de Edouard, et l\'a transformé en hôtel de luxe de quatre étoiles.'),
