(350, 156, 'historique', 'L\'histoire du Château de Saint Fargeau s\'étend sur 10 siècles. \r\n\r\n============\r\n\r\nEn 980, Héribert Evêque d\'Auxerre et demi-frère d\'Hugues Capet élève un rendez-vous de chasse fortifié. Du Xe au XVe siècle, le château a pour propriétaires des familles illustres : les seigneurs de Toucy, de Bar, et le célèbre argentier de Charles VII, Jacques Coeur. \r\n\r\n============\r\n\r\nA partir de 1453, Antoine de Chabannes fait construire sur les bases de l\'ancienne forteresse le château actuel, avec sa forme pentagonale, flanqué de six grosses tours. \r\n\r\n============\r\n\r\nEn 1652, Anne-Marie Louise d\'Orléans, la Grande Mademoiselle cousine germaine de Louis XIV, condamnée à cinq ans d\'exil à la suite des évènements de la Fronde s\'installe à Saint-Fargeau. Elle fait intervenir l\'architecte Le Vau sur les façades intérieures du château. Il laisse un des plus beaux exemples de classicisme français. \r\n\r\n============\r\n\r\nLa famille Lepeletier acquiert le château en 1713. Louis Michel Lepeletier, conventionnel célèbre, vota la mort de Louis XVI et mourut assassiné.'),
