(453, 164, 'historique', 'Le château historique de Tanlay est l’un des plus beaux spécimens de l’architecture de la Renaissance en Bourgogne.\r\n\r\n============\r\n\r\nDemeure de la famille de l’Amiral de Coligny, pendant les guerres de religion, il fût achevé par Michel Particelli d’Hemery, surintendant des finances de Mazarin, et devint, à la fin du XVII ème siècle, la propriété des Marquis de Tanlay. Depuis lors, le château, toujours habité, est resté dans la même famille.\r\n\r\n============\r\n\r\nCélèbre notamment pour la galerie en trompe l’œil et pour les fresques de la tour de la Ligue, le Château de TANLAY propose une Visite guidée intérieure, riche en mobilier et en décoration  murale. La visite extérieure vous fait découvrir les communs du château , ses douves, le nymphée, son canal, et son parc remarquables.'),
