(46, 1476783964, 'new', 'wfUpgrade', 1, 'f257ba4a61d5d8aebf7c59b6bbe41572', 'f257ba4a61d5d8aebf7c59b6bbe41572', 'Your WordPress version is out of date', 'WordPress version 4.6.1 is now available. Please upgrade immediately to get the latest security updates from WordPress.', 'a:2:{s:14:"currentVersion";s:5:"4.4.2";s:10:"newVersion";s:5:"4.6.1";}'),
(47, 1476783964, 'new', 'wfPluginUpgrade', 2, 'c8d7d867b15c3be0bdc6b4a9ae79ac2b', 'c8d7d867b15c3be0bdc6b4a9ae79ac2b', 'The Plugin "Akismet" needs an upgrade (3.1.10 -> 3.2).', 'You need to upgrade "Akismet" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:"Name";s:7:"Akismet";s:9:"PluginURI";s:19:"http://akismet.com/";s:7:"Version";s:6:"3.1.10";s:11:"Description";s:640:"Utilisé par des millions de sites, Akismet est très probablement la meilleure méthode au monde pour <strong>protéger votre blog contre les commentaires et les rétroliens abusifs</strong>. Il maintient votre site protégé contre le spam, même pendant votre sommeil. Pour vous lancer : 1) Cliquez sur le lien « Activer » à gauche de cette description, 2) <a href="http://akismet.com/get/">Inscrivez-vous pour récupérer votre clé d’API Akismet</a>, 3) Accédez à la page de configuration Akismet de votre blog, et renseignez votre clé d’API. <cite>par <a href="http://automattic.com/wordpress-plugins/">Automattic</a></cite>";s:6:"Author";s:65:"<a href="http://automattic.com/wordpress-plugins/">Automattic</a>";s:9:"AuthorURI";s:40:"http://automattic.com/wordpress-plugins/";s:10:"TextDomain";s:7:"akismet";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:41:"<a href="http://akismet.com/">Akismet</a>";s:10:"AuthorName";s:10:"Automattic";s:10:"pluginFile";s:48:"/web/LPBC/wp-content/plugins/akismet/akismet.php";s:10:"newVersion";s:3:"3.2";s:4:"slug";s:7:"akismet";s:5:"wpURL";s:37:"https://wordpress.org/plugins/akismet";s:20:"vulnerabilityPatched";b:0;}'),
(48, 1476783964, 'new', 'wfPluginUpgrade', 2, 'c4162a907fde6b5262efc5df0e0c6477', 'c4162a907fde6b5262efc5df0e0c6477', 'The Plugin "Contact Form 7" needs an upgrade (4.4.2 -> 4.5.1).', 'You need to upgrade "Contact Form 7" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:"Name";s:14:"Contact Form 7";s:9:"PluginURI";s:24:"http://contactform7.com/";s:7:"Version";s:5:"4.4.2";s:11:"Description";s:133:"Just another contact form plugin. Simple but flexible. <cite>par <a href="http://ideasilo.wordpress.com/">Takayuki Miyoshi</a></cite>";s:6:"Author";s:61:"<a href="http://ideasilo.wordpress.com/">Takayuki Miyoshi</a>";s:9:"AuthorURI";s:30:"http://ideasilo.wordpress.com/";s:10:"TextDomain";s:14:"contact-form-7";s:10:"DomainPath";s:11:"/languages/";s:7:"Network";b:0;s:5:"Title";s:53:"<a href="http://contactform7.com/">Contact Form 7</a>";s:10:"AuthorName";s:16:"Takayuki Miyoshi";s:10:"pluginFile";s:65:"/web/LPBC/wp-content/plugins/contact-form-7/wp-contact-form-7.php";s:10:"newVersion";s:5:"4.5.1";s:4:"slug";s:14:"contact-form-7";s:5:"wpURL";s:44:"https://wordpress.org/plugins/contact-form-7";s:20:"vulnerabilityPatched";b:0;}'),
(49, 1476783964, 'new', 'wfPluginUpgrade', 2, 'ceca00576b3d5614d08e072df9e609b0', 'ceca00576b3d5614d08e072df9e609b0', 'The Plugin "MailChimp pour WordPress" needs an upgrade (3.1.10 -> 4.0.6).', 'You need to upgrade "MailChimp pour WordPress" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:"Name";s:24:"MailChimp pour WordPress";s:9:"PluginURI";s:103:"https://mc4wp.com/#utm_source=wp-plugin&#038;utm_medium=mailchimp-for-wp&#038;utm_campaign=plugins-page";s:7:"Version";s:6:"3.1.10";s:11:"Description";s:161:"MailChimp for WordPress by ibericode. Adds various highly effective sign-up methods to your site. <cite>par <a href="https://ibericode.com/">ibericode</a></cite>";s:6:"Author";s:46:"<a href="https://ibericode.com/">ibericode</a>";s:9:"AuthorURI";s:22:"https://ibericode.com/";s:10:"TextDomain";s:16:"mailchimp-for-wp";s:10:"DomainPath";s:10:"/languages";s:7:"Network";b:0;s:5:"Title";s:142:"<a href="https://mc4wp.com/#utm_source=wp-plugin&#038;utm_medium=mailchimp-for-wp&#038;utm_campaign=plugins-page">MailChimp pour WordPress</a>";s:10:"AuthorName";s:9:"ibericode";s:10:"pluginFile";s:66:"/web/LPBC/wp-content/plugins/mailchimp-for-wp/mailchimp-for-wp.php";s:10:"newVersion";s:5:"4.0.6";s:4:"slug";s:16:"mailchimp-for-wp";s:5:"wpURL";s:46:"https://wordpress.org/plugins/mailchimp-for-wp";s:20:"vulnerabilityPatched";b:0;}'),
(50, 1476783964, 'new', 'wfPluginUpgrade', 2, '88afb31552417f28effacc97ee273ce4', '88afb31552417f28effacc97ee273ce4', 'The Plugin "Users Ultra Lite" needs an upgrade (1.5.84 -> 1.5.89).', 'You need to upgrade "Users Ultra Lite" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:"Name";s:16:"Users Ultra Lite";s:9:"PluginURI";s:21:"http://usersultra.com";s:7:"Version";s:6:"1.5.84";s:11:"Description";s:120:"This is a powerful user profiles plugin for WordPress. <cite>par <a href="https://usersultra.com">Users Ultra</a></cite>";s:6:"Author";s:48:"<a href="https://usersultra.com">Users Ultra</a>";s:9:"AuthorURI";s:22:"https://usersultra.com";s:10:"TextDomain";s:0:"";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:52:"<a href="http://usersultra.com">Users Ultra Lite</a>";s:10:"AuthorName";s:11:"Users Ultra";s:10:"pluginFile";s:53:"/web/LPBC/wp-content/plugins/users-ultra/xoousers.php";s:10:"newVersion";s:6:"1.5.89";s:4:"slug";s:11:"users-ultra";s:5:"wpURL";s:41:"https://wordpress.org/plugins/users-ultra";s:20:"vulnerabilityPatched";b:0;}'),
(51, 1476783964, 'new', 'wfPluginUpgrade', 2, 'cad3f0f15eaa780a6b4e50098a665470', 'cad3f0f15eaa780a6b4e50098a665470', 'The Plugin "Wordfence Security" needs an upgrade (6.2.0 -> 6.2.2).', 'You need to upgrade "Wordfence Security" to the newest version to ensure you have any security fixes the developer has released.', 'a:16:{s:4:"Name";s:18:"Wordfence Security";s:9:"PluginURI";s:25:"http://www.wordfence.com/";s:7:"Version";s:5:"6.2.0";s:11:"Description";s:135:"Wordfence Security &#8211; Anti-virus, Firewall and High Speed Cache <cite>par <a href="http://www.wordfence.com/">Wordfence</a></cite>";s:6:"Author";s:49:"<a href="http://www.wordfence.com/">Wordfence</a>";s:9:"AuthorURI";s:25:"http://www.wordfence.com/";s:10:"TextDomain";s:0:"";s:10:"DomainPath";s:0:"";s:7:"Network";b:1;s:5:"Title";s:58:"<a href="http://www.wordfence.com/">Wordfence Security</a>";s:10:"AuthorName";s:9:"Wordfence";s:10:"pluginFile";s:52:"/web/LPBC/wp-content/plugins/wordfence/wordfence.php";s:10:"newVersion";s:5:"6.2.2";s:4:"slug";s:9:"wordfence";s:5:"wpURL";s:39:"https://wordpress.org/plugins/wordfence";s:20:"vulnerabilityPatched";b:0;}'),
